import React from "react";
import "../../index.css";
import "./style.css";

function Welcome() {
  return (
    <div>
      <div className="card-panel cyan darken-1 aboutText">
        <h4 className="center">Welcome to my web development portfolio!</h4>
        <br />
        Here, you'll see the various projects I've completed while enrolled in
        UW's Full Stack Web Development BootCamp.

        <h5 > 
          <a 
          className="cyan darken-1 blue"
          href="projects">
            WebDev Project Portfolio
          </a>
        </h5>
        <br />
        <div>
          It's also an area for fiddling...
          </div>
      </div>{" "}
      <div className="card-panel cyan darken-1 aboutText">
        <h4>November, 2020:</h4>
      </div>
      <br /> <br /> <br /> <br />
    </div>
  );
}

export default Welcome;
